import React, { Component } from "react";
import {Redirect} from "react-router-dom";
import "./banner.css"

export default class Banner extends Component{
    constructor(props){
        super(props);
        this.state = {
            resume : false
        }
    }

    render() {
        return (
        <div id="banner">
            <div id="logo">
                <h1>Kasa</h1>
            </div>
            <div id="links">
                <ul>
                    <li className="link" onClick={ <Redirect to="/" />}>Accueil</li>
                    <li className="link">A propos</li>
                </ul>
            </div>
        </div>
        )
    }
}
